import React, { useState } from 'react';
import tw from 'tailwind-styled-components';
const SideNav = () => {
    return (
        <>
            <SideNavWrap className="p-[32px]">
                <div>
                    <div>근무/휴가</div>
                </div>
            </SideNavWrap>
        </>
    );
};



const SideNavWrap = tw.div`
  w-[240px] h-[calc(100vh + 50px)]] bg-[#F8F8F8]

`;

export default SideNav;
